        "#C A period 378 c/2 puffer.#C This is the first in a series of c/2 puffers having periods which#C are not a multiple of 4.  A phase-changing blinker puffer and a set#C of period 42 rakes creates a row of blinkers.#C Gliders from two more period 42 rakes ignite the blinker row, which#C burns faster than c/2 until it reaches a pair of period 6 ships.#C Then the cycle repeats.#C The next puffer in the series can be created by advancing all of the#C puffer except the rear rakes and their gliders by 168 generations.#C Then the resulting puffer has its period increased by 588 generations.#C The series thus contains periods 378, 966, 1554, and so on.#C Only 1/7 of the possible non-multiple of 4 periods using period 42#C rakes are covered by the series.  Adjusting the back rakes to ignite#C the blinker row in other ways may provide further coverage.#C This is a smaller version of a similar puffer built in March 2002.#C David I. Bell, 30 December 2008",
