        "jslife\rVersion 2012.12.30\r\rThis is Jason's collection of patterns for Conway's Game of Life.\r\rThe files contained in this archive are in a format called \"RLE\", which is \rwidely used for Life patterns. Most Life programs should recognize it.\r\rComments and questions may be sent to Jason Summers <jason1@pobox.com>.\r<http://entropymine.com/jason/life/>\r\r-----\r\rThe collection is subdivided into several separate directories (folders):\r\rapplications\r   (1) Patterns whose population over time is unusual.\r   (2) High-level patterns; patterns designed to calculate or\r       emulate something.\r   (I guess these two things may not have a lot in common, but\r   I don't want to have too many separate directories.)\r\rc2-extended\r   A by-period collection of c/2 spaceships, puffers, and (especially)\r   rakes.\r\rfuses\r   A collection of some ways that linearly-repeating patterns can decay.\r\rguns\r   Spaceship guns. Most ordinary glider guns would be put into\r   other collections instead of this one, so most of the guns here\r   are unusual in some way -- they may have an adjustable period,\r   or an unusual shape, or fire multiple spaceships or unusual\r   kinds of spaceships.\r\rinteractions\r   (For lack of a better name.)\r   Moving reactions that are supported by one or more guns or\r   puffers, which move at a different velocity than the reaction\r   itself.\r\rmisc\r   Anything that doesn't fit into another directory. Mostly,\r   reactions that are interesting or useful.\r\rosc\r   A by-period collection of oscillators.\r\rosc-supported\r   \"Oscillators\" for which the only known way to support them is to use\r   glider guns, or the moral equivalent of glider guns.\r\rslideguns\r   \"Guns\" that fire each glider on a separate path. See the section\r   below for more information.\r\rsynthesis\r   Patterns of gliders that collide to form complex objects.\r\rvelocity-...\r   Spaceships, puffers, stretchers, etc. Separated by velocity.\r\rwicks\r   Extensible oscillators, mostly untamed.\r\r\r----- Additional information about the \"c2-extended\" directory -----\r\rThis used to be a separate \"rakes\" collection, but I've incorporated\rit into this collection, and expanded it.\r\rTrue-period rakes are known for *all* multiples of 8, and all multiples\rof 4 higher than 564. The files \"var-072+8n.lif\" and \"var-???+24n.lif\"\rare the starting points for building them.\r\r\r----- Additional information about the \"osc\" directory -----\r\rRefer to the readme-osc.txt file.\r\r\r----- Additional information about the \"slideguns\" directory -----\r\rThe objects here are separated into two basic types: \"slide guns\" and \r\"tethered rakes\". The difference is that the rate of outward movement of a \rtethered rake is fixed, while a slide gun's outward movement can be adjusted \rby changing the period of the stationary part.\r\r(I may be abusing the term \"tethered rake\" when I use it to include patterns\rlike \"teth-o-014b-090.lif\" that aren't based on a spaceship or puffer.)\r\r\rFile naming convention:\r\rTYPE-D-XXd-YYY.lif\r\rTYPE: slide=slide gun, teth=tethered rake\r\rD: Direction of spaceship salvos, o=orthogonal, d=diagonal\r\rXX: Outward movement, in cells per period\r\rd: Direction of output relative to the pattern. Not always applicable.\r    (b=backward gliders, f=forward gliders)\r\rYYY: Apparent period of the stationary part (gun)\r\r\r----- Additional information about the \"wicks\" directory -----\r\rA \"wick\" is an infinite linearly repeating oscillator.\r\rA \"fencepost\" is an object that can stabilize one end of a wick. Most of \rthe wicks in this collection have no known fenceposts, so the patterns \rwill blow up pretty quickly. If a fencepost is known, it is usually \rincluded with the pattern. Uninteresting fenceposts for some of the high \rperiod wicks can be built by firing gliders at the ends -- some of these \rwould be very large, and are not included.\r\rThe period of a wick can be expressed in the form A/B, where A is the \rperiod, and A/B (divided out) is the number of generations it takes for a \rcongruent pattern to appear (the same pattern but possibly shifted and/or \rflipped). If A=B, the wick is called a \"barber pole\". Wicks where B=1 are \rusually the most interesting, since they are typically the easiest to \rstabilize.\r\rThis collection does not attempt to include every known wick. In fact, an \rinfinite number are known. Consider the following wicks:\r\r**..**..**..**    **..**.**..**.**.    **..**..**..**..**..\r**..**..**..**    **..**.**..**.**.    **..**..**..**..**..\r..............    .................    ....................\r**************    *****************    ********************\r..............    .................    ....................\r.***..***..***    .****..****..****    .*****..*****..*****\r**...**...**..    **....**....**...    **.....**.....**....\r.***..***..***    .****..****..****    .*****..*****..*****\r..............    .................    ....................\r**************    *****************    ********************\r..............    .................    ....................\r**..**..**..**    **..**.**..**.**.    **..**..**..**..**..\r**..**..**..**    **..**.**..**.**.    **..**..**..**..**..\r\r  Period 5/5          Period 6/6              Period 7/7\r\rThe series can be continued to produce a wick of any desired period.\r\rAny spaceship \"tagalong\" that can be extended in the direction of the \rspaceship's movement also constitutes a wick. For example:\r\r.*.........*.........*\r**......****......****\r*.....***.*.....***.*.\r*....**...*....**...*.\r**...*....**...*....**\r.***.*.....***.*.....*\r...****......****.....\r......*.........*.....\r\r    Period 20/10\r\rWicks of this type are usually not include in this collection.\r\rAlso not included are:\r\r * wicks that have been made finite, and are more interesting when \rconsidered to be an oscillator than a wick\r\r * wicks of period 3 or less\r\r\rMost of the wicks in this collection were found independently by me, using a \rrandom torus search program. However, a substantial fraction of them were \rdiscovered by other people. I have not gone to much effort to determine and give \rcredit to the first discoverer. In some cases that would be almost impossible \ranyway, since many of these wicks would not have been considered interesting \renough to make public.\r"
